import './App.css';
import {useState,useEffect} from 'react'


async function getJson() {
 var jsonData = await fetch('http://localhost:5000/api/item/1?by=ID')
  .then(response => response.json())
  .then(data => JSON.parse(data))
  return jsonData
}

function App() {

  const [items, setItems] = useState([])

  useEffect(() => {
    const setJson = async () => {
      var jsonRes = await getJson()
      setItems(jsonRes)
    }

    setJson()
  }, [])


  return (
    <div className="App">
      WHY
      {
        Object.keys(items).forEach(function(key, index) {
          <div>{items[key]}</div>
        })
      }
    </div>
  );
}

export default App;
